[[File:Spirit angler outfit equipped.png|125px|thumb|A player wearing the Spirit angler's outfit.]]
The '''Spirit angler's outfit''' is an [[experience-boosting set|experience-boosting clothing set]] that grants 2.5% additional [[experience]] when worn while training the [[Fishing]] skill. Wearing the set also acts as a [[rope]] for tethering to [[totem pole]]s and [[mast]]s while battling [[Tempoross]].

Showing the outfit to [[Kylie Minnow]] is suitable to gain access to the [[minnows]] in the [[Fishing Guild]], but does not need to be equipped. A particular Sherlock master skill challenge also allows the outfit be equipped in lieu of the [[angler's outfit]]. Pieces of the Spirit angler's outfit can be equipped alongside pieces of the [[Angler's outfit]] for the purpose of receiving the extra 0.5% set XP bonus.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1415626774810136580|date=15 July 2021|archiveurl=https://archive.md/Arggb|archivedate=4 November 2021|quote=You do get the extra 0.5% set bonus even by mix-&-match.}}

Equipping any piece in the set requires 34 Fishing. Bonus experience is not granted for [[random event]]s, [[experience lamp]]s, or [[Fishing tome|experience tomes]]. The potential experience saved getting level 99 may not be worth spending the time to get the set on average if current training methods are at least 70,000 experience per hour.

The Spirit angler's outfit can be stored in the [[Armour case space]] in the [[POH]] and the [[Tackle box|Tackle Box]].

==Obtaining==
Each outfit piece can be obtained by trading in 1,200 [[spirit flakes]], along with the corresponding angler's outfit piece to [[Gita Prymes]], making the entire outfit cost 4,800 spirit flakes. Spirit flakes are obtained from the [[reward pool]] after fighting [[Tempoross]]. Once the conversion fee for a given piece has been paid, further conversions to and from the [[angler's outfit]] version can be performed at no cost by using it on [[Gita Prymes|Gita]].

